text:
L'incaponimento di Draghi sul #catasto indica:
- che la sua priorità NON è combattere il Covid (su cui il governo è nato) e rilanciare l'economia ma un grande reset social-finanziario;
- e/o che Draghi sta cercando una via di fuga perché è troppa la polvere messa sotto il tappeto

“Se una donna africana scappa dall’Ucraina la devono accogliere?”

@SusannaCeccardi: “Bisogna vedere se scappa davvero dall’Ucraina. Non è facile stabilirlo: altrimenti diventa viatico per tutti quelli che scappano dall’Africa”.

Non è ignoranza; è razzismo. E fa schifo. Sempre. https://t.co/IrGVjwMF6H

