text:
@TruIeeIy Amico, mi segui da anni, cos'è questo tono?
Non solo abbiamo votato contro, ma in 9 su 45 abbiamo convinto altri a votare con noi (e contro il governo) fino ad arrivare ad un voto di differenza.
E bisognerà passare dall'aula (e dal senato)

Davanti all'invasione, all'uso folle della forza, non ci voltiamo dall’altra parte.
È l'Europa, tutta insieme, che oggi sta al fianco dell'#Ucraina. 

@EnricoLetta su #RussiaUcrainaconflict ha ricordato le parole di Bonhoeffer, tra i simboli della resistenza contro il nazismo. https://t.co/MdiGvHk7Dn

